<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <title>Check</title>
  <style>
    body {
      margin: 0;
      padding: 0;
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
      background: linear-gradient(to right, #ece9e6, #ffffff);
    }

    .container {
      max-width: 400px;
      margin: 100px auto;
      text-align: center;
    }

    h1 {
      margin-bottom: 40px;
      color: #333;
    }

    input[type="text"] {
      width: 80%;
      padding: 15px;
      font-size: 16px;
      border: 2px solid #ddd;
      border-radius: 5px;
      outline: none;
      transition: border-color 0.3s;
      box-shadow: 0 4px 6px rgba(0,0,0,0.1);
    }

    input[type="text"]:focus {
      border-color: #a0a0a0;
    }

    button {
      margin-top: 20px;
      padding: 15px 30px;
      font-size: 16px;
      border: none;
      background-color: #333;
      color: #fff;
      cursor: pointer;
      border-radius: 5px;
      transition: background-color 0.3s;
      box-shadow: 0 4px 6px rgba(0,0,0,0.1);
    }

    button:hover {
      background-color: #555;
    }

    #result {
      margin-top: 30px;
      font-size: 18px;
      color: #333;
      opacity: 0;
      transition: opacity 0.3s ease;
    }
  </style>
</head>
